import {useEffect, useState} from "react"
import Post from "./Post"

const Home = (user) => {
    const [data, setData] = useState([])

    useEffect(() => {
        fetch("/api/posts")
            .then(response => response.json())
            .then(json => setData(json))
    }, [])

    return (
        <div>
            <h2>Welcome to CodeShare</h2>
            <h3>Posts</h3>
            <ul>
                {data.map((post) => {
                    <Post></Post>
                })}
            </ul>
        </div>
    )
}

export default Home;
